import React, { Component } from "react";

class CustomerForm extends Component {
  constructor(props) {
    super(props);
    console.log(
      Object.entries(props).length === 0 && props.constructor === Object
    );
    if (Object.entries(props).length === 0 && props.constructor === Object) {
      this.state = {
        name: "",
        email: "",
        address: "",
        address2: "",
        city: "",
        zip: "",
        mobile_no: "",
        alt_mobile_no: ""
      };
    }
  }
  render() {
    return <div>Test</div>;
  }
}

export default CustomerForm;
